access within 48h of your friends registering. Your access will be valid for one week.</li>\\n<li>Your friends will be given five applications for free as soon as they register.</li>\\n</ul>\"',NULL,NULL,'text','Refer A Friend',0),(17,'referral.channels','Which Social Channels Are Displayed In Refer A Friend Missions.','[\"show_all\"]',NULL,'{\"show_all\":\"Show All\", \"show_none\":\"Show None\", \"fb\":\"Facebook\", \"tw\":\"Twitter\", \"pi\":\"Pinterest\", \"wa\":\"WhatsApp\", \"sm\":\"SMS\", \"ma\":\"Mail\"}','array','Refer A Friend',0),(31,'register.checkbox.terms','Term & Conditions checked by default','\"no\"',NULL,'{\"yes\":\"Yes\",\"no\":\"No\"}','select','Register',0),(32,'register.redirect_page','URL to redirect to after registration','\"select\"',NULL,'{\"select\":\"Select\",\"secure-upgrade\":\"Payment\"}','select','Register',0),(33,'register.redirect_page_mobile','URL to redirect to for mobile','\"select\"',NULL,'{\"select\":\"Select\",\"upgrade-mobile\":\"Payment\"}','select','Register',0),(35,'payment.braintree.register_billing_address','Braintree send register data as billing address','\"no\"','\"no\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Payments',0),(36,'memberships.active_text','Scholarship active subscription text','\"<div>amount: [[eligibility_amount]], count:[[eligibility_count]] If you need assistance&nbsp;learning how to use ScholarshipOwl, or have other questions regarding your account, please call us toll free at 1-800-494-4908.</div>\\n<div><br /></div>\\n<div>If you would like to cancel your membership, please call us for immediate assistance or click&nbsp;<a id=\\\"cancel-membership\\\" href=\\\"[[cancelUrl]]\\\">here</a>&nbsp;to cancel your subscription.&nbsp;</div>\\n<div><br /></div>\\n<div>We are available Monday through Friday, 10a.m. to 3p.m. Eastern Standard Time.</div>\"',NULL,NULL,'text','Memberships',1),(37,'memberships.cancelled_text','Scholarship cancell subscription text','\"Thank you. Your cancelation is being processed.<br /><br />You will not be charged any future subscription payments and your membership access will expire on [[expirationDate]].\"',NULL,NULL,'text','Memberships',1),(38,'scholarships.redirect_members','Scholarships page to display to members','\"scholarships\"','\"scholarships\"','{\"default\":\"URL Visited\",\"select\":\"Select\",\"scholarships\":\"Scholarships\"}','select','Scholarships',0),(39,'scholarships.redirect_free','Scholarships page to display to free users','\"select\"','\"select\"','{\"default\":\"URL Visited\",\"select\":\"Select\",\"scholarships\":\"Scholarships\"}','select','Scholarships',0),(41,'content.phone.show','Show phone number on website','\"no\"','\"yes\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Content',0),(43,'register.login_token_validity','Validity of login token sent in email in days','\"60\"','\"7\"','[]','int','Register',0),(44,'payment.braintree.default','Default account for braintree.','2',NULL,NULL,'int','Payments',0),(47,'disclaimer.enabled','Disclaimer enabled/disabled','\"yes\"','\"yes\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Disclaimer',0),(48,'disclaimer.text','Disclaimer text','\"Note: ScholarshipOwl does not guarantee the receipt of any scholarship. Upgrading to premium membership does not increase your chances of receiving a specific scholarship per se, but may increase the number of scholarships you can apply for in less time.\"',NULL,NULL,'text','Disclaimer',0),(49,'register.checkbox.call_visible','Allow call checkbox visible','\"yes\"','\"yes\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Register',0),(50,'register.checkbox.call','Allow call checkbox preticked','\"no\"','\"yes\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Register',0),(51,'register.checkbox.call_text','Allow call checkbox text','\"By clicking, I consent to be called or texted regarding educational opportunities at the phone number provided, including mobile number, using an automated dialing technology, which may contain pre-recorded messages. I may be contacted by ScholarshipOwl.com, DegreeSeed, College Support, and other partner companies regardless of being listed on a federal or state do not call list. This is a separate offer for education. Consent is not required as a condition of using this service.\"',NULL,NULL,'text','Register',0),(53,'memberships.free_trial_active_text','Memberships free trial active text','\"<div>count: [[eligibility_count]], amount [[eligibility_amount]] If you&nbsp;need assistance&nbsp;learning how to use ScholarshipOwl, or have other questions&nbsp;regarding&nbsp;your account, please call us toll free at 1-800-494-4908.<br /></div>\\n<div><br /></div>\\n<div>If you would like to cancel your membership, please call us for immediate assistance. You can also file a cancelation request <a id=\\\"cancel-membership\\\" href=\\\"[[cancelUrl]]\\\">here</a>, and it&nbsp;will be processed within 5 business days.</div>\\n<div><br /></div>\\n<div>We are available Monday through Friday, 10a.m. to 6p.m. Eastern Standard Time.</div>\"','\"\"','','text','Memberships',1),(56,'scholarships.offer_wall_after_apply','Link redirect after /select page','\"https://scholarshipowl.com/more-scholarships\"','\"\"','','string','Scholarships',0),(60,'memberships.freeTrial.cancel_subscription','Cancellation popup text','\"<p style=\\\"font-size: 11px;\\\"><span style=\\\"font-size: 10pt;\\\">Your trial membership will become inactive immediately upon cancellation and you will <span style=\\\"text-decoration: underline;\\\">no longer be able to submit applications</span>.</span></p>\\n<p style=\\\"font-size: 11px;\\\"><span style=\\\"font-size: 10pt;\\\">Your trial is set to expire and convert into a PREMIUM membership on [[subscription_free_trial_end_date]]. Keep your membership active to&nbsp;make the most of your membership while it remains free and get applied to your&nbsp;[[eligibility_count]] scholarship matches.</span></p>\"','\"\"','\"\"','text','Memberships',1),(61,'scholarships.offer_wall_after_apply_empty','Redirect if already applied on YDIT scholarship','\"https://scholarshipowl.com/my-account\"','\"\"','\"\"','string','Scholarships',0),(64,'memberships.cancel_subscription_text','Cancellation popup text (not free trial)','\"<p style=\\\"font-size: 11px;\\\"><span style=\\\"font-size: 10pt;\\\">Your next subscription payment will be canceled immediately and you will not be charged any future subscription payments.<br /><br />Your current membership access will remain active until&nbsp;[[subscription_renewal_date]].&nbsp;<span style=\\\"font-size: 13.3333px;\\\">Be sure to make the most of your membership while is still remains active and get applied to your</span><span style=\\\"font-size: 13.3333px;\\\">&nbsp;[[eligibility_count]] scholarship matches.</span><br /></span></p>\"','\"\"','\"\"','text','Memberships',1),(66,'scholarships.mobile_app_ad','Show mobile ad enabled/disabled','\"yes\"','\"yes\"','{\"yes\":\"Yes\",\"no\":\"No\"}','select','Scholarships',0);
