INSERT INTO `email` VALUES (1,2178926,'seron5',2184,'Inbox','<30623777.20170227133106.58b42a1a2547f7.14017468@mail10.wdc04.mandrillapp.com>','T111, welcome to your ScholarshipOwl application inbox','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n    <head>\n    	<!-- NAME: 1:2 COLUMN - BANDED -->\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n        <title>Maya, welcome to your ScholarshipOwl application inbox</title>\n    <style type=\"text/css\">\n		body,#bodyTable,#bodyCell{\n			height:100% !important;\n			margin:0;\n			padding:0;\n			width:100% !important;\n		}\n		table{\n			border-collapse:collapse;\n		}\n		img,a img{\n			border:0;\n			outline:none;\n			text-decoration:none;\n		}\n		h1,h2,h3,h4,h5,h6{\n			margin:0;\n			padding:0;\n		}\n		p{\n			margin:1em 0;\n			padding:0;\n		}\n		a{\n			word-wrap:break-word;\n		}\n		.ReadMsgBody{\n			width:100%;\n		}\n		.ExternalClass{\n			width:100%;\n		}\n		.ExternalClass,.ExternalClass p,.ExternalClass span,.ExternalClass font,.ExternalClass td,.ExternalClass div{\n			line-height:100%;\n		}\n		table,td{\n			mso-table-lspace:0pt;\n			mso-table-rspace:0pt;\n		}\n		#outlook a{\n			padding:0;\n		}\n		img{\n			-ms-interpolation-mode:bicubic;\n		}\n		body,table,td,p,a,li,blockquote{\n			-ms-text-size-adjust:100%;\n			-webkit-text-size-adjust:100%;\n		}\n		#bodyCell{\n			padding:0;\n		}\n		.mcnImage{\n			vertical-align:bottom;\n		}\n		.mcnTextContent img{\n			height:auto !important;\n		}\n	/*\n	@tab Page\n	@section background style\n	@tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\n	*/\n		body,#bodyTable{\n			/*@editable*/background-color:#d8e8ff;\n		}\n	/*\n	@tab Page\n	@section background style\n	@tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\n	*/\n		#bodyCell{\n			/*@editable*/border-top:0;\n		}\n	/*\n	@tab Page\n	@section heading 1\n	@tip Set the styling for all first-level headings in your emails. These should be the largest of your headings.\n	@style heading 1\n	*/\n		h1{\n			/*@editable*/color:#606060 !important;\n			display:block;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:40px;\n			/*@editable*/font-style:normal;\n			/*@editable*/font-weight:bold;\n			/*@editable*/line-height:125%;\n			/*@editable*/letter-spacing:-1px;\n			margin:0;\n			/*@editable*/text-align:left;\n		}\n	/*\n	@tab Page\n	@section heading 2\n	@tip Set the styling for all second-level headings in your emails.\n	@style heading 2\n	*/\n		h2{\n			/*@editable*/color:#404040 !important;\n			display:block;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:26px;\n			/*@editable*/font-style:normal;\n			/*@editable*/font-weight:bold;\n			/*@editable*/line-height:125%;\n			/*@editable*/letter-spacing:-.75px;\n			margin:0;\n			/*@editable*/text-align:left;\n		}\n	/*\n	@tab Page\n	@section heading 3\n	@tip Set the styling for all third-level headings in your emails.\n	@style heading 3\n	*/\n		h3{\n			/*@editable*/color:#606060 !important;\n			display:block;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:18px;\n			/*@editable*/font-style:normal;\n			/*@editable*/font-weight:bold;\n			/*@editable*/line-height:125%;\n			/*@editable*/letter-spacing:-.5px;\n			margin:0;\n			/*@editable*/text-align:left;\n		}\n	/*\n	@tab Page\n	@section heading 4\n	@tip Set the styling for all fourth-level headings in your emails. These should be the smallest of your headings.\n	@style heading 4\n	*/\n		h4{\n			/*@editable*/color:#808080 !important;\n			display:block;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:16px;\n			/*@editable*/font-style:normal;\n			/*@editable*/font-weigh