@editable*/color:#6DC6DD;\n			/*@editable*/font-weight:normal;\n			/*@editable*/text-decoration:underline;\n		}\n	/*\n	@tab Body\n	@section body style\n	@tip Set the background color and borders for your email\'s body area.\n	*/\n		#templateBody{\n			/*@editable*/background-color:#f3f8ff;\n			/*@editable*/border-top:5px solid #b0d0ff;\n			/*@editable*/border-bottom:5px none ;\n		}\n	/*\n	@tab Body\n	@section body text\n	@tip Set the styling for your email\'s body text. Choose a size and color that is easy to read.\n	*/\n		.bodyContainer .mcnTextContent,.bodyContainer .mcnTextContent p{\n			/*@editable*/color:#606060;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:15px;\n			/*@editable*/line-height:150%;\n			/*@editable*/text-align:left;\n		}\n	/*\n	@tab Body\n	@section body link\n	@tip Set the styling for your email\'s body links. Choose a color that helps them stand out from your text.\n	*/\n		.bodyContainer .mcnTextContent a{\n			/*@editable*/color:#6DC6DD;\n			/*@editable*/font-weight:normal;\n			/*@editable*/text-decoration:underline;\n		}\n	/*\n	@tab Columns\n	@section column style\n	@tip Set the background color and borders for your email\'s columns area.\n	*/\n		#templateColumns{\n			/*@editable*/background-color:#f3f8ff;\n			/*@editable*/border-top:0;\n			/*@editable*/border-bottom:5px solid #ffffff;\n		}\n	/*\n	@tab Columns\n	@section left column text\n	@tip Set the styling for your email\'s left column text. Choose a size and color that is easy to read.\n	*/\n		.leftColumnContainer .mcnTextContent,.leftColumnContainer .mcnTextContent p{\n			/*@editable*/color:#606060;\n			/*@editable*/font-family:Helvetica;\n			/*@editable*/font-size:15px;\n			/*@editable*/line-height:150%;\n			/*@editable*/text-align:left;\n		}\n	/*\n	@tab Columns\n	@section left column link\n	@tip Set the styling for your email\'s left column links. Choose a color that helps them stand out from your text.\n	*/\n		.leftColumnContainer .mcnTextContent a{\n			/*@editable